import { Component, OnInit } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { HotelService } from '../hotel.service';
import { Hotel } from '../hotel';
import { map, switchMap } from 'rxjs/operators';
import { of } from 'rxjs';

@Component({
  selector: 'app-hotel-edit',
  templateUrl: './hotel-edit.component.html'
})
export class HotelEditComponent implements OnInit {

  id!: string;
  hotel!: Hotel;
  feedback: any = {};

  constructor(
    private route: ActivatedRoute,
    private router: Router,
    private hotelService: HotelService) {
  }

  ngOnInit() {
    this
      .route
      .params
      .pipe(
        map(p => p['id']),
        switchMap(id => {
          if (id === 'new') { return of(new Hotel()); }
          return this.hotelService.findById(id);
        })
      )
      .subscribe({
        next: hotel => {
          this.hotel = hotel;
          this.feedback = {};
        },
        error: err => {
          this.feedback = {type: 'warning', message: 'Error loading'};
        }
      });
  }

  save() {
    this.hotelService.save(this.hotel).subscribe({
      next: hotel => {
        this.hotel = hotel;
        this.feedback = {type: 'success', message: 'Save was successful!'};
        setTimeout(async () => {
          await this.router.navigate(['/hotels']);
        }, 1000);
      },
      error: err => {
        this.feedback = {type: 'warning', message: 'Error saving'};
      }
    });
  }

  async cancel() {
    await this.router.navigate(['/hotels']);
  }
}
<ol class="breadcrumb float-right">
  <li class="breadcrumb-item"><a routerLink="/">Home</a></li>
  <li class="breadcrumb-item active">Hotel</li>
</ol>
<div class="card">
  <div class="header">
    <h2 class="title">Hotel Detail</h2>
  </div>
  <div class="content">
    <div *ngIf="feedback.message" class="alert alert-{{feedback.type}}">{{ feedback.message }}</div>
    <form *ngIf="hotel" #editForm="ngForm" (ngSubmit)="save()">

      <div class="form-group">
        <label>Id</label>
        {{hotel.id || 'n/a'}} 
      </div>

      <div class="form-group">
        <label for="name">Name</label>
        <input [(ngModel)]="hotel.name" id="name" name="name" class="form-control">
      </div>

      <div class="form-group">
        <label for="city">City</label>
        <input [(ngModel)]="hotel.city" id="city" name="city" class="form-control">
      </div>

      <div class="form-group">
        <label for="stars">Stars</label>
        <input [(ngModel)]="hotel.stars" id="stars" name="stars" class="form-control">
      </div>

      <button type="submit" class="btn btn-primary" [disabled]="!editForm.form.valid">Save</button>
      <button type="button" class="btn btn-secondary" (click)="cancel()">Cancel</button>
    </form>
  </div>
</div>
